import{_ as s,o as a,c as e,R as n}from"./chunks/framework.zUbWieqp.js";const m=JSON.parse('{"title":"1，配置缓存","description":"","frontmatter":{},"headers":[],"relativePath":"guide/Linux/dns/3-cloudflare_cache.md","filePath":"guide/Linux/dns/3-cloudflare_cache.md","lastUpdated":1701424498000}'),p={name:"guide/Linux/dns/3-cloudflare_cache.md"},o=n(`<h1 id="_1-配置缓存" tabindex="-1">1，配置缓存 <a class="header-anchor" href="#_1-配置缓存" aria-label="Permalink to &quot;1，配置缓存&quot;">​</a></h1><p>CloudFlare 并不使用 MIME type 去判断文件类型，而是直接使用副档名</p><ul><li>bmp 、class、css、csv、doc、docx、ejs、eot、eps、gif、ico、jar、jpeg、jpg、js、mid、midi、otf、pdf、pict、pls、png、ppt、pptx、ps、svg、svgz、swf、tif、tiff、ttf、webp、woff、woff2、xls、xlsx</li></ul><p>打开Rules----&gt;Page rules</p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202312011518260.jpg" alt=""></p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202312011518533.jpg" alt=""></p><div class="language-markup vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">markup</span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">Browser Cache TTL: a hour</span></span>
<span class="line"><span style="color:#e1e4e8;">Cache Level: Cache Everything</span></span>
<span class="line"><span style="color:#e1e4e8;">Edge Cache TTL: two hour</span></span>
<span class="line"><span style="color:#e1e4e8;"></span></span>
<span class="line"><span style="color:#e1e4e8;">浏览器缓存时间:1小时</span></span>
<span class="line"><span style="color:#e1e4e8;">缓存级别：缓存所有</span></span>
<span class="line"><span style="color:#e1e4e8;">边缘缓存时间：2小时  //这里最长可以是1个月，建议1个月</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">Browser Cache TTL: a hour</span></span>
<span class="line"><span style="color:#24292e;">Cache Level: Cache Everything</span></span>
<span class="line"><span style="color:#24292e;">Edge Cache TTL: two hour</span></span>
<span class="line"><span style="color:#24292e;"></span></span>
<span class="line"><span style="color:#24292e;">浏览器缓存时间:1小时</span></span>
<span class="line"><span style="color:#24292e;">缓存级别：缓存所有</span></span>
<span class="line"><span style="color:#24292e;">边缘缓存时间：2小时  //这里最长可以是1个月，建议1个月</span></span></code></pre></div><p>如果有后台页面就需要禁止后台缓存，设置一条cloudflare页面规则，不缓存后台访问页面。不然可能导致后台无法登陆上去</p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202312011518311.jpg" alt=""></p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202312011518070.jpg" alt=""></p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202312011518557.jpg" alt=""></p><h1 id="_2、速度优化" tabindex="-1">2、速度优化 <a class="header-anchor" href="#_2、速度优化" aria-label="Permalink to &quot;2、速度优化&quot;">​</a></h1><p><strong>Speed</strong>→<strong>Optimization</strong>，把 <strong>Auto Minify</strong> 的 JavaScript、CSS、HTML 都打勾，就会帮你压缩这些东西</p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202312011518707.jpg" alt=""></p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202312011546239.jpg" alt=""></p><h2 id="rocket-loader" tabindex="-1">Rocket Loader <a class="header-anchor" href="#rocket-loader" aria-label="Permalink to &quot;Rocket Loader&quot;">​</a></h2><p>Speed→Optimization 中</p><p>Rocket Loader 可以延迟载入你的 JavaScript 脚本，让浏览器优先处理你的文字、CSS 等跟「渲染（Render）」比较有关係的程序码，理论上能够加快使用者体验、降低首次渲染时间，提高 SEO</p><p><img src="https://nnaigos.oss-cn-hangzhou.aliyuncs.com/imgs/202312011518354.jpg" alt=""></p><p>除此之外，Rocket Loader 其实还会试图将 JavaScript 缓存在装置的 Local Storage 中，能更有效减少网络传递</p><p>国内关闭这个，如果开启这个k线加载有问题</p>`,21),c=[o];function t(l,i,r,g,h,d){return a(),e("div",null,c)}const _=s(p,[["render",t]]);export{m as __pageData,_ as default};
